import React from 'react'

export default class Mois extends React.Component {
    render () {
        return (
            <div>
                <button class="hollow button">Primary</button>
                <button class="hollow button">Secondary</button>
                <button class="hollow button">Success</button>
                <button class="hollow button">Alert</button>
                <button class="hollow button">Warning</button>
                <button class="hollow button">Disabled</button>
                <button class="hollow button">Primary</button>
                <button class="hollow button">Secondary</button>
                <button class="hollow button">Success</button>
                <button class="hollow button">Alert</button>
                <button class="hollow button">Warning</button>
                <button class="hollow button">Disabled</button>
            </div>
        );
    };
};
